import React from "react";
import "./App.css";
import Header from "./Header";
import Home from "./Home";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import Checkout from './Checkout';

function App() {
  return (
    // BEM
    <Router>
      <div className="app">
        <Switch>
        <Route path="/checkout">

            <Checkout/>

            <h1>
              Welcome to the Checkout Page. Awaiting You in the Payment Page
            </h1>
          </Route>
          <Route path="/">
            <Header />
            <Home />
          </Route>

        </Switch>
      </div>
    </Router>

    /*Home*/
  );
}

export default App;
